import React from 'react';
import { Line } from 'rc-progress';

class Percentage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      html: 95,
      photoshop: 95,
      sass: 85,
      javascript: 90,
      react: 85
    }
  }

  render() {
    return (
      <div className="w-100 flex items-center justify-between ph5">
        <span>
          Javascript
        </span>
        <div className="w-75">
          <Line percent="90" strokeWidth="7" trailWidth="0" strokeColor="#D3D3D3" />
        </div>
        <span>
          90%
        </span>
      </div>
    )
  }
}

export default Percentage
